"use strict";
$(window).load(function() {
    $(".loader").delay(500).fadeOut();
    $("#mask").delay(1000).fadeOut("slow");
});
$(document).ready(function() {
    $('a[href*=#]').click(function() {
        if (location.pathname.replace(/^\//, '') === this.pathname.replace(/^\//, '') && location.hostname === this.hostname) {
            var $target = $(this.hash);
            $target = $target.length && $target || $('[name=' + this.hash.slice(1) + ']');
            if ($target.length) {
                var targetOffset = $target.offset().top;
                $('html,body').animate({
                    scrollTop: targetOffset - 75
                }, 1000);
                return false;
            }
        }
    });
});

/* this div doesn't exist everywhere, so we are
checking for its existance... if we have it... 
then we do the onplay event handler, otherwise we don't.
*/
if ($('.video-container1 video').length > 0) { 
	$('.video-container1 video')[0].onplay = function() {
	    $('.loader').css('display', 'none');
	    $('.main-title').css('opacity', '1');
	};
} 
if( navigator.userAgent.match(/Android/i)
 || navigator.userAgent.match(/webOS/i)
 || navigator.userAgent.match(/iPhone/i)
 || navigator.userAgent.match(/iPad/i)
 || navigator.userAgent.match(/iPod/i)
 || navigator.userAgent.match(/BlackBerry/i)
 || navigator.userAgent.match(/Windows Phone/i)
 ){
     if (location.pathname == '/') {
         $(window).on('scroll', function() {
      		if (window.scrollY > 0) {
     	 		$('footer .contacts').removeClass('calltoaction');
     	 	}
     	 	else if (window.scrollY == 0) {
     			$('footer .contacts').addClass('calltoaction');
     	 	}
      	});
     }
 	
	$('.only-mobile').css('display', 'list-item');
	$('input[id$=_menu]').addClass('clickable');
 }
 
 /* adding and removing class indicating if menu is active (placed on body for css reasons) */
 
 $('#nav > li').on('mouseout', function(e) {
                    if (window.innerWidth > 974) 
                        $('body')[0].classList.remove('menuIsActive');
             }).on('mouseover', function(e) {
                    if (window.innerWidth > 974) 
                        $('body')[0].classList.add('menuIsActive'); 
             });
              
/* this is the same as above but for mobile (checkbox)*/
 $('input#for_jump_menu').on('change', function(e) {
     if (this.checked) $('body')[0].classList.add('menuIsActive');
     else $('body')[0].classList.remove('menuIsActive');
 });
 
$('#nav > li li').on('mouseover', function(e) {
	$('ul', this).addClass('submenu_active');
});

$('#nav > li > label:first-of-type').click(
	function(e) {
		if (!e.target.previousElementSibling.checked) {
			$('#nav :checked').attr('checked', false);	
		}
});
$(window).on('scroll', function() {
     if (location.pathname == '/') { //only on home page
    /****** change back once it goes live *******/
    //if (location.pathname == '/fly') { //only on home page
        var boxLocTop = $('.box')[0].getBoundingClientRect().top;
        var circleLocTop = $('.circle')[0].getBoundingClientRect().top;
        
        if ((window.innerHeight + window.scrollY) >= (boxLocTop + window.scrollY)) {
            if ((window.innerHeight + window.scrollY) >= (circleLocTop + window.scrollY)) {
                $('.circle').addClass('expanded').circleAnimation();
            }
            else {
                $('.icon').addClass('animate');
            }
        }
    }
    
    if (window.scrollY > 0) {
        $('header').removeClass('transparent-nav');
    } else if (window.scrollY == 0) {
    	if ($('header').hasClass('html5-video-bkgrnd')) {
        	$('header').addClass('transparent-nav');
        }
    }
});
$(document).ready(function() {
	if (!navigator.userAgent.match(/Android/i)
	 && !navigator.userAgent.match(/webOS/i)
	 && !navigator.userAgent.match(/iPhone/i)
	 && !navigator.userAgent.match(/iPad/i)
	 && !navigator.userAgent.match(/iPod/i)
	 && !navigator.userAgent.match(/BlackBerry/i)
	 && !navigator.userAgent.match(/Windows Phone/i) ){
	 	
	 	$('footer .contacts').removeClass('calltoaction');
	}
	$("#top-search-trigger").click(function(e) {
	    $('body').toggleClass('top-search-open');
	    if ($('body').hasClass('top-search-open')) {
	    	$('#nav li').css('pointer-events', 'none');
	    	$('#top-search').css('z-index', 2);
	        $('#top-search').find('form').show();
	        $('#top-search').find('img').hide();
	        $('#top-search').find('.close-icon').addClass('active').show();
	    }
	    e.stopPropagation();
	    e.preventDefault();
	});
	$('#top-search .close-icon').click(function(e) {
	    $('body').toggleClass('top-search-open');
	    $('#nav li').css('pointer-events', 'auto');
	    $('#top-search').css('z-index', -1);
	    $('#top-search').find('form').hide();
	    $('#top-search').find('img').show();
	    $('#top-search').find('.close-icon').removeClass('active').hide();
	});
    
    $('#clientele-logos').on('animationiteration', function() {
        document.querySelectorAll('#clientele-logos li').forEach(function(v) {
            v.style.order = getComputedStyle(v).order - 1;
        });
        
        this.firstElementChild.remove();
        var clone = this.firstElementChild.cloneNode(true);
        clone.style.order = '7';
        this.appendChild(clone);
    });
    
	$('.content.dark:first-of-type').prepend("<span id='breadcrumbs'><a href='/'>Home</a> </span>");
	//var displayText = location.pathname.substring(1).replace(/\//g, " &#9474; ");
	if (!location.pathname.match(/^\/$/)) {
		var pages = location.pathname.substring(1).split('/');
		pages.map(function(val, ind) {
			var prevPath = $('#breadcrumbs a:last-child').attr('href');
			$('#breadcrumbs').append(' &#9474; <a href="' + prevPath + val + (ind == pages.length -1 ? "" : "/") + '">' + val + '</a>');
		});	
	}
});
$(document).on('click', function(event) {
    if (!$(event.target).closest('#top-search').length) {
        $('body').toggleClass('top-search-open', false);
    }
});
$.fn.circleAnimation = function () {
  var $container = $('.circle');

  function  animateCircle (e) {
    var $circles = $container.find('.circle__item');

    $circles.each(function(i, elm) {
      $(elm).find('.circle__line').css('animation', 'dash'+ (i + 1) +' 1s '+ (i / 2) +'s ease forwards');
    });
  }
  animateCircle();
}